import React from 'react';
import './App.css';
import Header from './Header';
import Home from './Home'
import { BrowserRouter, Routes, Route}
from "react-router-dom";

function App() {
  return (
    <BrowserRouter>
      <Routes>
        <Route path="/*" element={
          <div clasName="app">     
            <Header />
            <Home />   
          </div>
        } />
        <Route path="checkout" element={
          <div clasName="app">     
            <h1>gekko</h1>  
          </div>
        } />
      </Routes>
    </BrowserRouter>
  );
}

export default App;
